@tova_leigh: "When a father can r*** his own daughter, then sue and collect a cheque for $10,000 if she doesn't carry the pr3pnancy - you know it's not about "life". And yes, this effects everyone no matter where you are in the world, not only because other states are soon to follow and it's already happening in other places in the word (Poland for example), but also because of what it means for women in general. It's time we say what these laws are really about - c0ntrolling women and denying us of our basic right of freedom over our own b0dies. Because if as women we do not have full c0ntrol over our own b0bies, then we are not free, and if we are not free, then we are not equal."

